import React from 'react'
import './Card.css'

interface Props {
  companyName: string;
  ticker: string;
  price: number;
}

  const Card: React.FC<Props> = ({companyName, ticker, price}: Props) : JSX.Element => {
  return (
    <div className="card">
        <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRCvh-j7HsTHJ8ZckknAoiZMx9VcFmsFkv72g&s" 
        alt="Image" />
        <div className='details'>
            <h2>{companyName} ({ticker})</h2>
            <p>{price}</p>
        </div>
        <p className='infon'>Тест</p>
    </div>
  )
}

export default Card
